import Card from "../../../ui/card/Card";
import "./name.scss";

type NameProps = {
  firstName: string;
  middleName: string;
  lastName: string;
  role: string;
};

function Name(props: NameProps) {
  return (
    <Card className="name">
      <div className="name__container">
        <p className="name__container-firstname">{props.firstName}</p>
        <p className="name__container-middlename">{props.middleName}</p>
        <p className="name__container-lastname">{props.lastName}</p>
        <p className="name__container-role">{props.role}</p>
      </div>
    </Card>
  );
}

export default Name;
